import React, {Component} from 'react'

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }

    getMeet = () => {
        let token = localStorage.getItem('token');
        fetch('http://localhost:8000/api/getMeet', {
            headers: {
                Authorization: `JWT ${localStorage.getItem('token')}`
            },
            body: JSON.stringify({token: token, email: this.props.userState.email})
        })
            .then(res => res.json())
            .then(json => {
                console.log("getMeet", json);
            });
    }

    render() {
        const logged_in_dashboard = (
            <div>
                Welcome {this.props.userState.email}
            </div>)

        const logged_out_dashboard = (
            <div>
                Login To View Dashboard
            </div>)

        if(this.props.userState.logged_in){
            this.getMeet();
        }

        return (
            
            <div>
                <br /><br /><br /><br />
                {
                    this.props.userState.logged_in ? logged_in_dashboard : logged_out_dashboard
                }

            </div>
        )
    }
}

export default Dashboard;
